    e.preventDefault();
  };

  return (
    <form onSubmit={handleSubmit}>
      <h3>Register</h3>
      <lable>Email</lable>
      <input
        value={email}
        type="email"
        placeholder="email"
        onChange={(e) => setEmail(e.target.value)}
      ></input>
      <lable>Password</lable>
      <input
        value={password}
        type="password"
        placeholder="password"
        onChange={(e) => setPassword(e.target.value)}
      ></input>
    </form>
  );
}

export default Register;
